import React from "react";
import "./App.scss";
import MainLayout from "./layouts/MainLayout";
import routes, { RenderRoutes } from "./routes";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
        <MainLayout>{RenderRoutes(routes)}</MainLayout>
      </BrowserRouter>
    </div>
  );
}

export default App;
